  qunit.module("Unit | Db #registerIdentityManagers and #identityManagerFor", function () {
    qunit.test("identityManagerFor returns ember-cli-mirage default IdentityManager if there aren't any custom ones", function (assert) {
      var db = new Db();
      assert.equal(db.identityManagerFor("foo"), IdentityManager);
    });
    qunit.test("it can register identity managers per db collection and for application", function (assert) {
      var FooIdentityManager = function FooIdentityManager() {
        _classCallCheck(this, FooIdentityManager);
      };

      var ApplicationIdentityManager = function ApplicationIdentityManager() {
        _classCallCheck(this, ApplicationIdentityManager);
      };

      var db = new Db();
      db.registerIdentityManagers({
        foo: FooIdentityManager,
        application: ApplicationIdentityManager
      });
      assert.equal(db.identityManagerFor("foo"), FooIdentityManager, "it allows to declare an identity manager per db collection");
      assert.equal(db.identityManagerFor("bar"), ApplicationIdentityManager, "it falls back to application idenitity manager if there isn't one for a specific db collection");
    });
    qunit.test("it can register idenitity managers on instantiation", function (assert) {
      var CustomIdentityManager = function CustomIdentityManager() {
        _classCallCheck(this, CustomIdentityManager);
      };

      var db = new Db(undefined, {
        foo: CustomIdentityManager
      });
      assert.equal(db.identityManagerFor("foo"), CustomIdentityManager);
      assert.equal(db.identityManagerFor("bar"), IdentityManager);
    });
  });

